  @override
  String get privacyBlock7 =>
      'Luật bảo vệ dữ liệu hiện hành cấp cho bạn các quyền toàn diện với tư cách là chủ thể dữ liệu (quyền thông tin và can thiệp) đối với bên kiểm soát liên quan đến việc xử lý dữ liệu cá nhân của bạn mà chúng tôi sẽ thông báo cho bạn bên dưới:\n\n- Quyền được thông tin theo Nghệ thuật. 15 GDPR: Đặc biệt, bạn có quyền lấy thông tin về dữ liệu cá nhân của bạn do chúng tôi xử lý, mục đích xử lý, danh mục dữ liệu cá nhân được xử lý, người nhận hoặc danh mục người nhận mà dữ liệu của bạn đã hoặc sẽ được tiết lộ, thời gian lưu trữ theo kế hoạch hoặc tiêu chí để xác định thời gian lưu trữ, sự tồn tại của quyền cải chính, xóa, hạn chế xử lý, phản đối xử lý, khiếu nại với cơ quan giám sát, nguồn gốc dữ liệu của bạn nếu dữ liệu đó không được chúng tôi thu thập từ bạn, sự tồn tại của dữ liệu tự động ra quyết định, bao gồm lập hồ sơ và, nếu có, thông tin có ý nghĩa về logic liên quan cũng như tầm quan trọng và hậu quả dự kiến của việc xử lý đó đối với bạn, cũng như quyền của bạn được thông báo về các đảm bảo tồn tại theo Nghệ thuật. 46 GDPR khi dữ liệu của bạn được chuyển sang nước thứ ba;\n\n- Quyền cải chính theo Nghệ thuật. 16 GDPR: Bạn có quyền chỉnh sửa ngay lập tức dữ liệu không chính xác liên quan đến bạn và/hoặc hoàn thiện dữ liệu chưa đầy đủ do chúng tôi lưu trữ.\n\n- Quyền xóa theo Nghệ thuật. 17 GDPR: Bạn có quyền yêu cầu xóa dữ liệu cá nhân của mình nếu các điều kiện của Nghệ thuật. 17(1) GDPR được đáp ứng. Tuy nhiên, quyền này không áp dụng cụ thể nếu việc xử lý là cần thiết để thực hiện quyền tự do ngôn luận và thông tin, để tuân thủ nghĩa vụ pháp lý, vì lý do lợi ích công cộng hoặc để thiết lập, thực hiện hoặc bảo vệ các khiếu nại pháp lý.\n\n- Quyền hạn chế xử lý theo Nghệ thuật. 18 GDPR: Bạn có quyền yêu cầu hạn chế xử lý dữ liệu cá nhân của mình trong thời gian tính chính xác của dữ liệu đó đang được xác minh nếu bạn phản đối việc xóa dữ liệu của mình với lý do xử lý dữ liệu không được chấp nhận và thay vào đó, hãy yêu cầu hạn chế xử lý dữ liệu của bạn nếu bạn cần dữ liệu của mình để xác nhận, thực hiện hoặc bảo vệ các khiếu nại pháp lý sau khi chúng tôi không còn cần dữ liệu này để thực hiện mục đích thu thập dữ liệu đó hoặc nếu bạn đã gửi phản đối vì những lý do liên quan đến tình huống cụ thể của bạn, miễn là vẫn chưa rõ liệu lý do chính đáng của chúng tôi có thắng thế hay không;\n\n- Quyền được thông báo theo Nghệ thuật. 19 GDPR: Nếu bạn đã thực hiện quyền cải chính, xóa hoặc hạn chế xử lý đối với bên kiểm soát, thì bên kiểm soát có nghĩa vụ thông báo cho tất cả người nhận mà dữ liệu cá nhân của bạn đã được tiết lộ về việc chỉnh sửa hoặc xóa dữ liệu hoặc hạn chế xử lý này, trừ khi điều này được chứng minh là không thể hoặc đòi hỏi nỗ lực không tương xứng. Bạn có quyền được thông báo về những người nhận này.\n\n- Quyền di chuyển dữ liệu theo Nghệ thuật. 20 GDPR: Bạn có quyền nhận dữ liệu cá nhân mà bạn đã cung cấp cho chúng tôi ở định dạng có cấu trúc, được sử dụng phổ biến và có thể đọc được bằng máy hoặc yêu cầu chuyển dữ liệu đó sang bộ điều khiển khác, nếu khả thi về mặt kỹ thuật.\n\n- Quyền rút lại sự đồng ý theo quy định của Nghệ thuật. 7(3) GDPR: Bạn có quyền rút lại sự đồng ý của mình đối với việc xử lý dữ liệu bất cứ lúc nào với hiệu lực trong tương lai. Trong trường hợp rút tiền, chúng tôi sẽ xóa dữ liệu liên quan ngay lập tức, trừ khi việc xử lý tiếp theo có thể dựa trên cơ sở pháp lý để xử lý mà không có sự đồng ý. Việc rút lại sự đồng ý không ảnh hưởng đến tính hợp pháp của việc xử lý dựa trên sự đồng ý trước khi rút lại.\n\n- Quyền khiếu nại theo quy định tại Điều. 77 GDPR: Nếu bạn cho rằng việc xử lý dữ liệu cá nhân của mình vi phạm GDPR, bạn có quyền khiếu nại với cơ quan giám sát, đặc biệt là tại Quốc gia thành viên nơi bạn cư trú, nơi bạn làm việc hoặc nơi bị cáo buộc vi phạm mà không ảnh hưởng đến bất kỳ biện pháp xử lý hành chính hoặc tư pháp nào khác.';

